import React from 'react';
import Calendar from 'react-calendar';
import '../App.css';

function Home({ isLoggedIn, onLogout }) {
  return (
    <div className="Home">
      <h1>메인 화면입니다.</h1>
      <div>
        <Calendar />
      </div>
    </div>
  );
}

export default Home;
